	var itemTemplate = "{{#list items}}{{/list}}";
	itemTemplate = handlebars.compile(itemTemplate);

	var def = {
			level: 3,		// 2 or 3
			box: '#cs-box',

			// init data
			province: '河南',
			city: '',
			area: '',

			prefix: 'cs-',
			className: 'cs-item'
		};


	var CitySelector = new S.Class();

	CitySelector.fn.init = function(options) {
		this.options = $.extend({}, options, def);
		var prefix = this.options.prefix;

		this.template = handlebars.compile($('#' + this.options.prefix + 'template').html());
		this.$box = $(this.options.box);
		this.$box.html(this.template(this.options));
		
		this.$province = $('#' + prefix + 'province');
		this.$city = $('#' + prefix + 'city');
		this.$area = $('#' + prefix + 'area');

		this.bind();

		this.renderProvince(this.options.province);
		this.renderCity(this.options.city);
		this.renderArea(this.options.area);
	};

	CitySelector.include({
		bind: function() {
			this.$province.on('change', this.proxy(function() {
				this.renderCity();
				this.renderArea();
			}));
			if (this.options.level == 3) {
				this.$city.on('change', this.proxy(function() {
					this.renderArea();
				}));
			};

		},
		renderProvince: function(val) {
			var $elem = this.$province;
	
			$elem.html(this.getHtml(data));
			$elem.val(val);
		},
		renderCity: function(val) {
			var $elem = this.$city;

			var province = this.$province.val();

			$elem.html(this.getHtml(data[province]));
			$elem.val(val);
		},
		renderArea: function(val) {
			var $elem = this.$area;

			var province = this.$province.val(),
				city = this.$city.val();

			var html = itemTemplate({
				items: _.values(data[province][city])
			});
			$elem.html(html);
			$elem.val(val);
		},
		getHtml: function(d){
			var keys = _.keys(d),
				html = itemTemplate({
					items: keys
				});
			return html;
		}
	});

	return CitySelector;
